import * as React from "react";
import { Routes, Route, Link } from "react-router-dom";
import stylesheet from './styles.js'
import Button from './Button';
import styles from './Button.module.css';
import { useNavigate } from 'react-router-dom';



function Interest() {
	  const navigate = useNavigate();
		return (
			<div style={stylesheet.body}>
				<h1>Choose your Universe</h1>
				<Button onClick={()=> navigate("interest")} title="Get Started" />
				<Button path="/interest" title="Gaming Universe" />
				<Button path="/interest" title="NFT Universe" />
				<Button path="/interest" title="Music Universe" />
			</div>
		);


}

export default Interest;
